INSERT INTO `article` VALUES ('63', 'qweqwr', '1', '木鸟', '<h1 style=\"margin: 0px; padding: 0px 0px 10px; font-weight: normal; font-stretch: normal; font-size: 27px; line-height: 38px; font-family: 微软雅黑, &quot;Microsoft Yahei&quot;, 黑体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">习近平新时代外交理念 这四方面笃行不变</h1><h2 style=\"margin: 0px; padding: 0px 0px 27px; font-weight: normal; font-stretch: normal; font-size: 21px; line-height: 32px; font-family: 微软雅黑, &quot;Microsoft Yahei&quot;, 黑体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\"></h2><p><span class=\"info\" style=\"float: left; font-family: Arial, 宋体; position: relative;\"><span style=\"font-weight: bold; font-family: 宋体; margin-right: 20px;\"><a href=\"http://news.cntv.cn/\" target=\"_blank\" style=\"text-decoration-line: none; color: rgb(51, 51, 51); padding-right: 2px;\">新闻频道</a>&nbsp;<span style=\"font-weight: inherit; background: url(&quot;image/option2.png&quot;) no-repeat; display: inline-block; height: 12px; width: 12px; transition: all 0.2s ease-in 0s;\"></span></span><span style=\"font-weight: inherit;\">来源：央视网 2017年11月25日 07:00</span></span><span class=\"font\" style=\"float: right; margin-right: 129px;\"><a title=\"字号缩小\" style=\"color: rgb(255, 255, 255); background: url(&quot;image/font_jiada_bg.jpg&quot;) left 0px no-repeat; display: inline-block; margin-left: 10px; text-align: center; width: 21px;\">A-</a><a title=\"字号加大\" style=\"color: rgb(255, 255, 255); background: url(&quot;image/font_jiada_bg.jpg&quot;) left 0px no-repeat; display: inline-block; margin-left: 10px; text-align: center; width: 21px;\">A+</a></span><span class=\"shouji\" style=\"cursor: pointer; float: right; margin-right: 10px; position: relative;\"><a href=\"http://news.cntv.cn/mobile/index.shtml\" title=\"手机观看\" style=\"text-decoration-line: none; color: rgb(51, 51, 51); display: inline-block; width: 13px; height: 21px; background: url(&quot;image/shouji.jpg&quot;) left 0px no-repeat; cursor: pointer;\"></a></span></p><p><span class=\"share\" style=\"background: url(&quot;image/share_bg.png&quot;) 12px center no-repeat; cursor: pointer; display: block; font-weight: bold; padding: 11px 20px 11px 37px;\">我要分享<span style=\"font-weight: inherit; border-width: 5px; border-style: solid; border-color: rgb(117, 117, 117) rgb(255, 255, 255) rgb(255, 255, 255); border-image: initial; display: block; height: 0px; overflow: hidden; position: absolute; right: 6px; top: 20px; transition: top 1s, all 0.3s ease-in 0s;\"></span></span></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　中国人民愿同各国人民一道，推动人类命运共同体建设，共同创造人类的美好未来！</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-align: right;\">——习近平</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong>央视网消息：</strong>11月24日，习近平会见缅甸国防军总司令敏昂莱。这是十九大之后习近平第七次在京会见国外领导人及政要。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　恰恰在一个月之前——2017年10月25日，党的十九大刚刚闭幕，习近平带领党的新一届中央领导集体与中外记者见面时承诺：将同各国人民一道，积极推动构建人类命运共同体，不断为人类和平与发展的崇高事业作出新的更大的贡献。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　新时代中国外交怎么干？习近平用行动作出了表率。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong>中国要做稳定之锚</strong></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　世界那么大，问题那么多。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　新时代中国特色大国外交锐意进取、攻坚克难的恒心不会变！</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img src=\"/ueditor/php/upload/image/20171126/1511664698.png\" alt=\"1\"/></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<span style=\"font-family: KaiTi_GB2312;\">11月10日，国家主席习近平应邀出席在越南岘港举行的亚太经合组织工商领导人峰会并发表题为《抓住世界经济转型机遇谋求亚太更大发展》的主旨演讲。 （图片来源：新华社）</span></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　2017年11月10日，习近平在亚太经合组织工商领导人峰会发表主旨演讲时坚定地表示：“中国人民讲求以和为贵、协和万邦。我们将坚持走和平发展道路，始终做世界和亚太地区的和平稳定之锚。”</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　回想今年年初，习近平在联合国日内瓦总部演讲时说：中国人始终认为，世界好，中国才能好；中国好，世界才更好。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　索马里护航、尼泊尔地震救援、也门撤侨等一系列重大事件，中国冲在一线、表现优异，赢得世界尊敬。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　推动国际地区热点问题解决，维护世界安定和平。27年来，中国累计派出维和军事人员3.5万余人次，先后参加了24项联合国维和行动，是联合国安理会常任理事国中派遣维和人员最多的国家，维和摊款比重居世界第二。国际社会赞誉中国为“联合国维和行动的重要贡献者”。一系列维护世界稳定的正义之举换来世人赞许目光。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong>中国要做经济增长发动机</strong></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　世界怎么了，我们怎么办？</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　新时代中国特色大国外交共赢共享、互联互通的信心不会变！</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　十九大报告指出，中国开放的大门不会关闭，只会越开越大。要以“一带一路”建设为重点，坚持引进来和走出去并重，遵循共商共建共享原则，加强创新能力开放合作，形成陆海内外联动、东西双向互济的开放格局。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　习近平在今年的亚太经合组织工商领导人峰会上再次明确表示，中国对外开放的脚步不会停滞。中国将同各国一道，深入推进“一带一路”建设，中国将实行高水平的贸易和投资自由化便利化政策，大幅度放宽市场准入，扩大服务业对外开放，保护外商投资合法权益。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　2013至2016年，中国经济年均增长7.2%，明显高于世界同期2.6%的平均水平；中国对世界经济平均贡献率31.6%，超过美国、欧元区、日本贡献率总和，是世界经济增长第一引擎。同时，中国还是世界第二大经济体，进出口总额世界第二、对外服务贸易总额世界第二、对外直接投资总额世界第二……</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　未来15年，中国市场将进一步扩大，发展将更加全面。预计将进口24万亿美元商品，吸收2万亿美元境外直接投资，对外投资总额将达到2万亿美元。中国的发展将为世界各国发展带来更多机遇。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<strong>中国要做和平发展的推动者</strong></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　和平发展，时代主题。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　新时代中国特色大国外交开放包容、亲仁善邻的理念不会变！</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img src=\"/ueditor/php/upload/image/20171126/1511664698.png\" alt=\"1\"/></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<span style=\"font-family: KaiTi_GB2312;\">11月8日下午，国家主席习近平和夫人彭丽媛在北京故宫博物院迎接来华进行国事访问的美国总统特朗普和夫人梅拉尼娅。（图片来源：新华社）</span></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　11月8日，习近平夫妇陪同特朗普夫妇参观故宫三殿。两国元首夫妇沿故宫中轴线，依次参观了太和殿、中和殿、保和殿，体会着三大殿名称中蕴含的“和”的涵义。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　十九大报告强调，中国倡导国际关系民主化，坚持国家不分大小、强弱、贫富一律平等，支持联合国发挥积极作用，支持扩大发展中国家在国际事务中的代表性和发言权。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　2013年10月，新中国成立以来首次周边外交工作座谈会在京召开，习近平在会上提出“亲、诚、惠、容”的周边外交理念。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img src=\"/ueditor/php/upload/image/20171126/1511664699.png\" alt=\"1\"/></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<span style=\"font-family: KaiTi_GB2312;\">7月18日，中国国家主席习近平在北京人民大会堂同巴勒斯坦国总统阿巴斯举行会谈。会谈后，阿巴斯授予习近平“巴勒斯坦国最高勋章”，以表达对中方支持巴正义事业的深切感谢和对习近平本人的崇高敬意。（图片来源：中新社）</span></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　2017年7月18日，正在中国访问的巴勒斯坦国总统阿巴斯郑重授予习近平“巴勒斯坦国最高勋章”，感谢他亲力亲为，为中东和平贡献智慧与力量。一枚跨越万里的勋章，寄托着一份深沉由衷的敬意。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　2017年11月，越南、老挝“一会两国”之行，是中共十九大胜利闭幕后，中国党和国家最高领导人首次出访。深耕周边、扎根亚太、辐射全球，实现了十九大后中国新时代外交的亮丽开局。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　大国、周边、发展中国家……习近平的足迹遍及全球五大洲，实现对不同类型国家元首外交的全覆盖，引领中国外交在复杂多变的国际格局中始终保持战略主动地位。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　巴基斯坦伊斯兰堡政策研究所所长拉赫曼说：“过去两个世纪，世界见证了太多因为财富和势力范围而引发的战争，但中国再次重申了维护世界和平的承诺。中国不仅是世界和平的维护者，而且为世界发展作出了贡献，非常值得赞赏。”</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　<strong>　中国要做全球治理好伙伴</strong></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　大道之行，天下为公。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　新时代中国特色大国外交责任担当、主动作为！</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　英国广播公司报道说，中国的十九大是一次“站在世界地图前”召开的大会——中国正在成为全球市场之网中“新的服务器”，“站在世界地图前”谋划维护世界和平与促进共同发展的中国共产党，将为世界经济的未来提供新的智慧与方案。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255); text-align: center;\"><img src=\"/ueditor/php/upload/image/20171126/1511664700.png\" alt=\"1\"/></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　<span style=\"font-family: KaiTi_GB2312;\">5月14日，国家主席习近平在北京出席“一带一路”国际合作高峰论坛开幕式，并发表题为《携手推进“一带一路”建设》的主旨演讲。这是习近平同出席“一带一路”国际合作高峰论坛的代表们合影。（图片来源：新华社）</span></p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　构建人类命运共同体，关键在行动。中国积极参与全球治理，留下无数精彩瞬间：</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　亚太经合组织领导人北京会议，燕山脚下鸿雁展翅，引领亚太区域合作飞向辽阔天空。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　二十国集团领导人杭州峰会，钱塘江上勇立潮头，推动G20向长效治理机制转型，取得一系列开创性、引领性、机制性成果。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　达沃斯世界经济论坛年会掌声如潮。习近平倡导经济全球化向开放、包容、普惠、平衡、共赢方向发展，赢得国际社会广泛赞誉。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　“一带一路”国际合作高峰论坛，全球盛会应者云集。开放的中国为联动发展凝聚合力，为完善全球治理贡献智慧。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　“构建人类命运共同体”载入联合国决议。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　“一带一路”从愿景走向现实。</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　……</p><p style=\"margin-top: 0px; margin-bottom: 28px; padding: 0px; font-stretch: normal; line-height: 1.75em; font-family: Arial, 宋体; color: rgb(51, 51, 51); white-space: normal; background-color: rgb(255, 255, 255);\">　　国际社会普遍认为，中国共产党领导的中国坚持和平发展道路，坚持推动构建人类命运共同体，为充满不确定性的国际局势提供巨大的稳定性，为人类社会对美好未来的追求注入强大正能量，为全球治理体系改革和建设不断贡献中国智慧，提供中国方案。（文/刘禛）</p><p><br/></p>', '0', '1511664708', '1511664708', '1');
